import React, {Component} from 'react';
import NombreNaves from '../components/NombreNaves';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles.css';

class Naves extends Component{
    state = {
    array: []
    }
    componentDidMount() {
        const {nombre} = this.props;
        const url = nombre;
        axios.get(url).then(response => response.data)
        .then((data) => {
            console.log(data);
        this.setState({ array: data.name })
        })
    }

    render() {
        return (
            <div className="mt-5 container">
              <div className="row">
              {this.state.array.map((data) =>(
                  <div className="elemto col-md-12 shadow p-3 mb-5 bg-white rounded animated fadeIn">
                    <div className="col-md-12">
                        <NombreNaves nameNave={data}></NombreNaves>
                    </div>
                  </div>))}
              </div> 
            </div>
          );
      }
    }

    export default Naves;
